import React, { Component } from 'react'
import verify from '../assets/svg/verify.svg';
// import deposit from '../assets/svg/deposit.svg'

export default class ThirdSlide extends Component {
  render() {
    return (
      <div className="third-slide">
        <div className="third-title text-center">Why book with APARTOLINO?</div>
        <div className="grid">
          <div className="grid-item">
            <img src={verify} alt="" />
            <div className="grid-title"></div>
            <div className="grid-text"></div>
          </div>
          <div className="grid-item"></div>
          <div className="grid-item"></div>
          <div className="grid-item"></div>
          <div className="grid-item"></div>
          <div className="grid-item"></div>
        </div>
      </div>
    )
  }
}
